

BEGIN TRANSACTION;
BEGIN TRY

	if exists(select * from tempdb..sysobjects where id = object_id('tempdb..#TEMP_LIQUIDACIONES'))
	drop table #TEMP_LIQUIDACIONES

    create table #TEMP_LIQUIDACIONES
    (
        IdTabla numeric(5) not null identity(1,1),
        NumFondo numeric(6,0),
        CodFondo numeric(5),
        CodTpLiquidacion varchar(2) collate database_default,
        TpoValorCuotaparteAbrev varchar(30),
        CodTpValorCp numeric(3),
        AgColocadorNombre varchar(80),
        CodAgColocador numeric(5),
        SucursalNombre varchar(80),
        CodSucursal numeric(5),
        OficialNombre varchar(80),
		OficialApellido varchar(80),
        CodOficialCta numeric(5),
        NumLiquidacion numeric(15),
        CondicionIngEgrDesc varchar(80),
        CodCondicionIngEgr numeric(5),
        NumCuotapartista numeric(15,0),
        CodCuotapartista numeric(10),
        Importe numeric(19,2),
        CantCuotapartes numeric(22,8),
        FechaConcertacion smalldatetime,
        FechaLiquidacion smalldatetime,
        EsRechazo smallint,
        MonedaSimbolo varchar(6),
        CodMoneda numeric(5),
        FactConvMonFdoSol numeric(16,10),
        CodAuditoriaRef numeric(10),
        EstaAnulado smallint,
        SeEmitioInstrPago smallint,
        Reclasifica smallint,
        YaExiste smallint
    )





    UPDATE #TEMP_LIQUIDACIONES 
    SET CodFondo = FONDOSREAL.CodFondo
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN FONDOSREAL ON UPPER(#TEMP_LIQUIDACIONES.NumFondo) COLLATE database_default = UPPER(FONDOSREAL.NumFondo) COLLATE database_default

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodTpValorCp = TPVALORESCP.CodTpValorCp
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN TPVALORESCP ON UPPER(#TEMP_LIQUIDACIONES.TpoValorCuotaparteAbrev) COLLATE database_default = UPPER(TPVALORESCP.Abreviatura) COLLATE database_default
                            AND TPVALORESCP.CodFondo = #TEMP_LIQUIDACIONES.CodFondo

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodCondicionIngEgr = CONDICIONESINGEGR.CodCondicionIngEgr
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN CONDICIONESINGEGR ON UPPER(#TEMP_LIQUIDACIONES.CondicionIngEgrDesc) COLLATE database_default = UPPER(CONDICIONESINGEGR.Descripcion) COLLATE database_default
                                    AND CONDICIONESINGEGR.CodFondo = #TEMP_LIQUIDACIONES.CodFondo

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodCuotapartista = CUOTAPARTISTAS.CodCuotapartista
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN CUOTAPARTISTAS ON UPPER(#TEMP_LIQUIDACIONES.NumCuotapartista) COLLATE database_default = UPPER(CUOTAPARTISTAS.NumCuotapartista) COLLATE database_default

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodAgColocador = AGCOLOCADORES.CodAgColocador
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN AGCOLOCADORES ON UPPER(#TEMP_LIQUIDACIONES.AgColocadorNombre) COLLATE database_default = UPPER(AGCOLOCADORES.Descripcion) COLLATE database_default

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodSucursal = SUCURSALES.CodSucursal
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN SUCURSALES ON UPPER(#TEMP_LIQUIDACIONES.SucursalNombre) COLLATE database_default = UPPER(SUCURSALES.Descripcion) COLLATE database_default


	UPDATE #TEMP_LIQUIDACIONES 
    SET CodOficialCta = OFICIALESCTA.CodOficialCta
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN OFICIALESCTA ON UPPER(#TEMP_LIQUIDACIONES.OficialNombre) COLLATE database_default = UPPER(OFICIALESCTA.Nombre) COLLATE database_default
	AND UPPER(#TEMP_LIQUIDACIONES.OficialApellido) COLLATE database_default = UPPER(OFICIALESCTA.Apellido) COLLATE database_default
	AND OFICIALESCTA.CodSucursal = #TEMP_LIQUIDACIONES.CodSucursal
	AND OFICIALESCTA.CodAgColocador = #TEMP_LIQUIDACIONES.CodAgColocador

    UPDATE #TEMP_LIQUIDACIONES 
    SET CodMoneda = MONEDAS.CodMoneda
    FROM #TEMP_LIQUIDACIONES
    INNER JOIN MONEDAS ON UPPER(#TEMP_LIQUIDACIONES.MonedaSimbolo) COLLATE database_default = UPPER(MONEDAS.Simbolo) COLLATE database_default

    update #TEMP_LIQUIDACIONES
    set --CodMoneda = @CodMoneda
        EsRechazo = 0 
        ,FactConvMonFdoSol = 1
        ,EstaAnulado = 0
        ,SeEmitioInstrPago = 0
        ,Reclasifica = 0
        ,CodTpLiquidacion = 'SM'
        --,CodAgColocador = (select CodAgColocador from CUOTAPARTISTAS where CUOTAPARTISTAS.CodCuotapartista = #TEMP_LIQUIDACIONES.CodCuotapartista)
        --,CodSucursal = (select CodSucursal from CUOTAPARTISTAS where CUOTAPARTISTAS.CodCuotapartista = #TEMP_LIQUIDACIONES.CodCuotapartista) 
        --,Importe = 0
    --where CodFondo = @CodFondo 


    --insert into #TEMP_LIQUIDACIONES(CodFondo, CodTpValorCp, CodAgColocador, CodSucursal, CodCondicionIngEgr, CodCuotapartista, CantCuotapartes, 
    --	EsRechazo, CodMoneda, FactConvMonFdoSol, EstaAnulado, SeEmitioInstrPago, Reclasifica,CodTpLiquidacion,FechaConcertacion,FechaLiquidacion)
    --select CodFondo, CodTpValorCp, CodAgColocador, CodSucursal, CodCondicionIngEgr, CodCuotapartista, CantCuotapartes,
    --	EsRechazo, CodMoneda, FactConvMonFdoSol, EstaAnulado, SeEmitioInstrPago, Reclasifica,CodTpLiquidacion,FechaConcertacion,FechaLiquidacion
    --from #TEMP_LIQUIDACIONES

    /*
    update #TEMP_LIQUIDACIONES
    set CodTpLiquidacion = 'SM',
        FechaConcertacion = '20151231',
        FechaLiquidacion = '20151231'
        */

    -- Manejo de la numeracion de las liquidaciones

    declare @MaxValue smallint
    declare @MinValue smallint
    declare @iIteracion smallint
    declare @CodFondoActual numeric(5,0)
    declare @CodFondoAnt numeric(5,0)
    declare @NumLiquidacion numeric(15,0)

    -- Auditoria
    declare @CodAuditoriaRef CodigoLargo

    select @MinValue = min(idTabla) from #TEMP_LIQUIDACIONES
    select @MaxValue = max(IdTabla) from #TEMP_LIQUIDACIONES

    select @iIteracion = 1
    set @NumLiquidacion = 1

    SELECT @CodFondoAnt = CodFondo FROM #TEMP_LIQUIDACIONES where IdTabla = 1 and CodAuditoriaRef is null

    while @iIteracion <= @MaxValue begin

        
        if exists(SELECT idTabla FROM #TEMP_LIQUIDACIONES where IdTabla = @iIteracion and CodAuditoriaRef is null)
        begin
            
            SELECT @CodFondoActual = CodFondo FROM #TEMP_LIQUIDACIONES where IdTabla = @iIteracion and CodAuditoriaRef is null

            if @CodFondoActual <> @CodFondoAnt
            begin
                set @NumLiquidacion = 1
            end

            INSERT AUDITORIASREF (NomEntidad)
            VALUES ('LIQ')
            SELECT @CodAuditoriaRef = @@IDENTITY

            update #TEMP_LIQUIDACIONES
            set CodAuditoriaRef = @CodAuditoriaRef,
            NumLiquidacion = @NumLiquidacion
            where IdTabla = @iIteracion and CodAuditoriaRef is null
        
            INSERT AUDITORIASHIST (CodAccion, CodUsuario, Fecha, Terminal, CodAuditoriaRef)
            VALUES ('LIQa', 1, Getdate(), Host_name(), @CodAuditoriaRef)
            
            set @NumLiquidacion = @NumLiquidacion + 1
            set @CodFondoAnt = @CodFondoActual

        end

        select @iIteracion = @iIteracion + 1

    end


    SELECT CodFondo, CodTpLiquidacion, CodTpValorCp, CodAgColocador, CodSucursal, CodOficialCta, NumLiquidacion, CodCondicionIngEgr, CodCuotapartista, Importe, CantCuotapartes, FechaConcertacion, FechaLiquidacion, EsRechazo, CodMoneda, FactConvMonFdoSol, CodAuditoriaRef, EstaAnulado, SeEmitioInstrPago, Reclasifica 
    FROM #TEMP_LIQUIDACIONES


END TRY
BEGIN CATCH
SELECT
	ERROR_NUMBER() AS ErrorNumber
        , ERROR_SEVERITY() AS ErrorSeverity
        , ERROR_STATE() AS ErrorState
        , ERROR_PROCEDURE() AS ErrorProcedure
        , ERROR_LINE() AS ErrorLine
        , ERROR_MESSAGE() AS ErrorMessage;

IF @@TRANCOUNT > 0
        ROLLBACK TRANSACTION;
END CATCH;

IF @@TRANCOUNT > 0
    COMMIT TRANSACTION;

GO
